
/**
 * Creates an object that contains data on an individual spot
 */
 class SpotsInfo {
    #lotLetter;
    #spID;
    #isOpen;
    #gridLocation;
    #display;
    #content;

    constructor(lotLetter, spID, isOpen, gridLocation) {
        this.#lotLetter = lotLetter;
        this.#spID = spID;
        this.#isOpen = isOpen;
        this.#gridLocation = gridLocation;
        this.#display = L.circle(this.#gridLocation, {radius: 2, color: 'black'});
        this.#content = "";
    }

    get lotLetter() {
        return this.#lotLetter;
    }
    get spID() {
        return this.#spID;
    }
    get isOpen() {
        return this.#isOpen;
    }
    get gridLocation() {
        return this.#gridLocation;
    }
    get display() {
        return this.#display;
    }
    get content() {
        return this.#content;
    }

    set isOpen(isOpen) {
        this.#isOpen = isOpen;
    }
    set content(content) {
        this.#content = content;
    }

	changeColor(color) {
		this.#display.setStyle({radius: 2, color: color});
	}

	changeOpacity(opacity) {
		this.#display.setStyle({fillOpacity: opacity});
	}
}

